import React from "react";
import "./Rightbar.css";
function Rightbar() {
  return (
    <div className="rightbar">
      <div className="rightbarWrapper">
        <div className="birthdayContainer">
          <img src="/assets/gift.png" alt="birthday pic" />
          <span className="birthdayText">
            <b>Tanishq Mehta</b> and<b>3 other friends</b> have birthday today
          </span>
        </div>
      </div>
    </div>
  );
}
export default Rightbar;
